import React from 'react';
import './css/cachet.css';

type Props = {
    titre: string,
    auteur: string,
    photoAuteur: string
}

const Cachet: React.FC<Props> = ({ titre, auteur, photoAuteur }) => {

    return (
        <div className="cachetContainer">
            <div className="info">
                <h3>{titre}</h3>
                <span>{auteur}</span>
            </div>
            <div className="auteur" style={{backgroundImage: `url(${photoAuteur})`}}></div>
        </div>
    );
}

export default Cachet;
